@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

@base <http://www.example.com/ontology/healthcare> .

:EmailNotification a owl:Class ;
  rdfs:subClassOf :Notification .

:Appointment a owl:Class ;
  rdfs:subClassOf :Event .

:Patient a owl:Class .

:sends a owl:ObjectProperty ;
  rdfs:domain :System ;
  rdfs:range :EmailNotification .

:to a owl:ObjectProperty ;
  rdfs:domain :EmailNotification ;
  rdfs:range :Patient .

:for a owl:ObjectProperty ;
  rdfs:domain :EmailNotification ;
  rdfs:range :Appointment .

<System> a owl:NamedIndividual, :System ;
  :sends :EmailNotification1 .

:EmailNotification1 a owl:NamedIndividual, :EmailNotification ;
  :to :Patient1 ;
  :for :Appointment1 .

:Patient1 a owl:NamedIndividual, :Patient .

:Appointment1 a owl:NamedIndividual, :Appointment .
